 Verdana;"> TecnologÃ­a inversora con alta frecuencia, monitoreo del flujo del lÃ­quido de enfriamiento, corriente piloto ajustable entre 3 y 15 amps. dependiendo del diÃ¡metro del electrodo, flujÃ³metro para arco piloto y gas plasma. Permite iniciarse en el proceso de plasma soldadura, alta productividad, baja distorsiÃ³n, cordones de alta calidad, alta densidad de energÃ­a. <em><strong>Ideal para soldar cobre y sus aleaciones.</strong></em></span></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana;">Ventajas de la soldadura por Arco Plasma:</span></strong><span style="font-size: 8.0pt; font-family: Verdana;"> Menor deformaciÃ³n de los materiales, Alta velocidad de aplicaciÃ³n (comparado contra el proceso TIG), Mayor penetraciÃ³n en los cordones, Libre de salpicaduras, Mayor estabilidad de arco, No se contamina el electrodo de Tungsteno.</span></p><p class="MsoNormal"><strong><em><span style="font-size: 8.0pt; font-family: Verdana;">* Alta tecnologÃ­a y calidad en una sola mÃ¡quina, consulte a su asesor INFRA.</span></em></strong></p>', '', '3058', NULL, 0, '2011-07-30 02:40:03', 1, '2012-01-10 19:39:15', NULL, 0, 1, 0),
