INSERT INTO `gases` (`id`, `name`, `short`, `image`, `smallimage`, `description`, `infra_link`, `codigo`, `SKU`, `fullitem_id`, `created`, `creator_id`, `modified`, `modifier_id`, `pmig`, `ptig`, `psmaw`, `ppac`) VALUES
(1, 'INFRAMIXX 200/2', '(Permite mejor penetraciÃ³n en lÃ¡minas y placas delgadas)', 'img/gases/Cilindro_bigMezclas.jpg', 'img/gases/thumb/Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41323</strong></span></p><p>Mezclas adecuadas para soldar aceros al carbono, de baja aleaciÃ³n, galvanizados e inoxidables, tanto en lÃ¡minas como en placas.</p><p>La cantidad exacta de CO<sub>2</sub> en estas mezclas no interfiere en la composiciÃ³n quÃ­mica del metal base y por lo tanto no afecta las propiedades mecÃ¡nicas del mismo.</p><p>Recomendado para espesores de material base: Calibre 16 a 1/4â€.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41323', 'SKU41323', 0, '2011-04-22 18:33:45', 1, '2015-02-26 02:17:18', NULL, 1, 0, 0, 0),
(2, 'INFRAMIXX 200/8', '(Permite mejor penetraciÃ³n en lÃ¡minas y placas delgadas)', 'img/gases/2011-07-12-202503Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202503Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41326</strong></span></p><p>Mezclas adecuadas para soldar aceros al carbono, baja aleaciÃ³n, galvanizados e inoxidables, tanto en lÃ¡minas como en placas.</p><p>La cantidad exacta de CO<sub>2</sub> en estas mezclas no interfiere en la composiciÃ³n quÃ­mica del metal base y por lo tanto no afecta las propiedades mecÃ¡nicas del mismo.</p><p>Recomendado para espesores de material base: calibre 16 a 1/4â€.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41326', NULL, 0, '2011-05-25 02:16:42', 1, '2012-02-20 10:27:07', NULL, 1, 0, 0, 0),
(3, 'ALUMIXX', '(Favorece la penetraciÃ³n y aumenta la velocidad de aplicaciÃ³n)', 'img/gases/2011-07-12-202757Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202757Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41328</strong></span></p><p>Mezcla perfecta que por su alto contenido de ArgÃ³n, proporciona una excelente estabilidad de arco en la soldadura con procesos GMAW y GTAW. Ideal para soldar metales no ferrosos (de gran espesor) como son:Â Aluminio y sus aleaciones, Cobre y sus aleaciones, e incluso metales ferrosos como el Acero Inoxidable.</p><p>Esta mezcla<strong>Â </strong>proporciona un gran aporte tÃ©rmico al arco elÃ©ctrico de soldadura, utilizando menor amperaje y voltaje, lo que incrementa un gran ahorro de energÃ­a elÃ©ctrica.</p><p>Gracias a esta caracterÃ­stica se logra una excelente penetraciÃ³n de la soldadura, es una mezcla ideal para soldar piezas de metales con gran capacidad de conducciÃ³n tÃ©rmica y elÃ©ctrica.</p>', 'http://www.infra.com.mx/inframixx/alumixx.html', '41328', NULL, 0, '2011-05-25 02:17:50', 1, '2012-02-20 12:10:18', NULL, 1, 1, 0, 0),
(4, 'ARGÃ“N ALTA PUREZA', '(EconÃ³mico, ofrece buena limpieza y brillo en la soldadura)', 'img/gases/32025.png', 'img/gases/thumb/32025.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 32025</strong></span></p><p>El uso de este gas como atmÃ³sfera de protecciÃ³n, ofrece una buena limpieza y brillo en la soldadura. Su pureza esta altamente controlada, es econÃ³mico y recomendado para soldaduras radiografiadas.</p><p>Preferentemente se emplea para soldaduras de Aluminio y Aceros Inoxidables que cumplen con requerimientos bajo la Norma AWS 5.32</p>', '', '32025', NULL, 0, '2011-05-25 02:20:37', 1, '2012-04-04 19:53:57', NULL, 1, 1, 0, 0),
(5, 'INFRAMIXX 200/O2', '(Brinda los mejores acabados en lÃ¡minas y placas delgadas)', 'img/gases/2011-07-12-202815Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202815Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41324</strong></span></p><p>Excelentes mezclas para soldar lÃ¡minas y placas de acero al carbono, baja aleaciÃ³n e inoxidable (especialmente los de grado L y ELC). Facilita el arco spray proporcionando una limpieza magnÃ­fica por su efecto descarburante.</p><p>Arco muy estable, sin salpicadura. Facilita el arco spray obteniendo acabado del cordÃ³n de calidad y limpieza. Facilita la aplicaciÃ³n manual y mejora las caracterÃ­sticas de aplicaciÃ³n de procesos automatizados y robÃ³ticos.</p><p>Recomendado para espesores de material base: Calibre 22 hasta 1/8â€.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41324', NULL, 0, '2011-05-25 02:23:16', 1, '2012-02-22 11:12:22', NULL, 1, 0, 0, 0),
(6, 'INFRAMIXX 200/O5', '(Brinda los mejores acabados en lÃ¡minas y placas delgadas)', 'img/gases/2011-07-12-202848Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202848Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41322</strong></span></p><p>Excelentes mezclas para soldar lÃ¡minas y placas de acero al carbono, baja aleaciÃ³n e inoxidable (especialmente los de grado L y ELC). Facilita el arco spray proporcionando una limpieza magnÃ­fica por su efecto descarburante.</p><p>Arco muy estable, sin salpicadura. Facilita el arco spray obteniendo acabado del cordÃ³n de calidad y limpieza. Facilita la aplicaciÃ³n manual y mejora las caracterÃ­sticas de aplicaciÃ³n de procesos automatizados y robÃ³ticos.</p><p>Recomendado para espesores de material base: Calibre 22 hasta 1/8â€.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41322', NULL, 0, '2011-05-25 02:23:47', 1, '2012-02-20 10:04:57', NULL, 1, 0, 0, 0),
(7, 'INFRAMIXX 200/20', '(Excelente penetraciÃ³n y mayor velocidad de aplicaciÃ³n contra el CO2)', 'img/gases/2011-07-12-202902Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202902Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41321</strong></span></p><p>Mezclas clÃ¡sicas muy recomendables para soldadura por corto circuito. Para soldar aceros al carbono y de baja aleaciÃ³n. Sustituyen al CO<sub>2</sub> en el proceso donde se requiere mayor estabilidad del arco y conservaciÃ³n de las propiedades mecÃ¡nicas del material base. Ideal para aplicaciones con proceso FCAW (alambres tubulares).</p><p>Mayor velocidad de la aplicaciÃ³n con excelente penetraciÃ³n, menor salpicadura y por lo tanto menor tiempo de trabajo posterior de limpieza. Aplicaciones en toda posiciÃ³n con corto circuito.Â Menor consumo de energÃ­a elÃ©ctrica.Â </p><p>Recomendado espesores de material base: 1/2â€ y mayores.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41321', NULL, 0, '2011-05-25 02:24:08', 1, '2012-02-20 10:49:18', NULL, 1, 0, 0, 0),
(8, 'INFRAMIXX 200/25', '(Excelente penetraciÃ³n y mayor velocidad de aplicaciÃ³n contra el CO2)', 'img/gases/2011-07-12-202918Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202918Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41320</strong></span></p><p>Mezclas clÃ¡sicas muy recomendables para soldadura por corto circuito. Para soldar aceros al carbono y de baja aleaciÃ³n. Sustituyen al CO<sub>2</sub> en el proceso donde se requiere mayor estabilidad del arco y conservaciÃ³n de las propiedades mecÃ¡nicas del material base. Ideal para aplicaciones con proceso FCAW (alambres tubulares).</p><p>Mayor velocidad de la aplicaciÃ³n con excelente penetraciÃ³n, menor salpicadura y por lo tanto menor tiempo de trabajo posterior de limpieza. Aplicaciones en toda posiciÃ³n con corto circuito.Â Menor consumo de energÃ­a elÃ©ctrica.</p><p>Recomendado espesores de material base: 1/2â€ y mayores.</p>', 'http://www.infra.com.mx/inframixx/mixx.html', '41320', NULL, 0, '2011-05-25 02:24:25', 1, '2012-02-20 11:19:48', NULL, 1, 0, 0, 0),
(9, 'INFRA FERRO D', '(Incrementa la velocidad de aplicaciÃ³n con excelente acabado en espesores delgados)', 'img/gases/2011-07-12-202930Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202930Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41317</strong></span></p><p>Mezcla ideal para soldar aceros al carbÃ³n y de baja aleaciÃ³n en placas delgadas. Ofrece una mejor estabilidad (control) de arco y una inmejorable calidad del producto final con mÃ­nimas deformaciones en la placa base.</p><p>Permite alta velocidad de aplicaciÃ³n, depositando cordones lisos y limpios sin salpicaduras. Reduce consumos de energÃ­a elÃ©ctrica y aumentaÂ la velocidad del proceso hasta en un 26% (comparado contra las mezclas convencionales), lo que incrementa la productividad y reducciÃ³n de los costos de producciÃ³n.</p><p>Recomendado para espesores de material base:Â Calibre 16 hasta 3/4â€.Â </p>', 'http://www.infra.com.mx/inframixx/ferro.html', '41317', NULL, 0, '2011-05-25 02:24:51', 1, '2012-02-20 10:33:17', NULL, 1, 0, 0, 0),
(10, 'INFRA FERRO G', '(Incrementa la velocidad de aplicaciÃ³n con excelente acabado en espesores gruesos)', 'img/gases/2011-07-12-202942Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202942Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41316</strong></span></p><p>Mezcla ideal para soldar aceros al carbÃ³n y de baja aleaciÃ³n en placas gruesas (de gran espesor). Ofrece un incremento en la velocidad del proceso hasta de 23% (comparado contra las mezclas convencionales), lo que incrementa la productividad y reducciÃ³n de los costos de producciÃ³n.</p><p>Mezcla ternaria con la que se obtienen grandes ventajas en penetraciÃ³n y velocidad de avanceÂ con niveles mÃ­nimos de porosidad y sin salpicaduras, ademÃ¡s de un excelente control del arco y charco de soldadura.Â Adecuada para aplicaciones con alambres sÃ³lidos y tubulares.</p><p>Recomendado para espesores de material base: 1/2â€ y mayores.</p>', 'http://www.infra.com.mx/inframixx/ferro.html', '41316', NULL, 0, '2011-05-25 02:25:27', 1, '2012-02-20 11:02:45', NULL, 1, 0, 0, 0),
(11, 'INFRA INOXXMAG', '(Permite un arco estable, limpieza en cordones y baja emisiÃ³n de humos)', 'img/gases/2011-07-12-202955Cilindro_bigMezclas.jpg', 'img/gases/thumb/2011-07-12-202955Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41318</strong></span></p><p>Mezcla de tres componentes, excelente para procesos de alta producciÃ³n en aceros inoxidables austenÃ­ticos con proceso GMAW.Â Permiten un arco adecuado tanto en placa (espesores de Calibre 16 en adelante) como en tuberÃ­a.</p><p>Alta productividad, limpieza en cordones, menor generaciÃ³n de humos y ozono, los principales beneficios de esta trimezcla.</p><p>Un preciso balance en los contenidos de sus componentes favorece un excelente acabado del cordÃ³n de soldadura, brillante y plano.Â La velocidad del proceso se incrementa un 15% contra las mezclas convencionales, lo que proporciona un incremento en la productividad y reducciÃ³n de costos de producciÃ³n.</p>', 'http://www.infra.com.mx/inframixx/inoxx.html', '41318', NULL, 0, '2011-05-25 02:25:50', 1, '2012-02-22 11:04:16', NULL, 1, 0, 0, 0),
(13, 'INOXX TAG X1', '(Permite aplicar cordones con excelente penetraciÃ³n, mayor velocidad y limpieza)', 'img/gases/Cilindro_Mezclas2.png', 'img/gases/thumb/2011-08-23-001257Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41335</strong></span></p><p>Mezclas de dos componentes para soldar aceros inoxidables austenÃ­ticos de alta producciÃ³n en proceso GTAW con mayor velocidad, penetraciÃ³n y excelente acabado.Â Esta lÃ­nea de mezclas para soldar con proceso GTAW (TIG/TAG) se emplea tanto para procesos manuales como automatizados.</p><p>Incrementa la velocidad del proceso hasta un 30% comparada contra el ArgÃ³n puro, lo que proporciona un incremento en la productividad y reducciÃ³n de costos de producciÃ³n.</p><p>Permite aplicar cordones planos con excelente penetraciÃ³n, limpieza y de mayor velocidadÂ en cualquier espesor.</p>', 'http://www.infra.com.mx/inframixx/inoxx.html', '41335', NULL, 0, '2011-08-15 20:34:53', 1, '2012-04-04 19:54:36', NULL, 0, 1, 0, 0),
(14, 'INOXX TAG', '(Permite el incremento en velocidad de aplicaciÃ³n y limpieza en cordones)', 'img/gases/2011-08-23-001400Cilindro_Mezclas2.png', 'img/gases/thumb/2011-08-23-001400Cilindro_Mezclas.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 41319</strong></span></p><p>Mezclas de dos componentes para soldar aceros inoxidables austenÃ­ticos de alta producciÃ³n en proceso GTAW con mayor velocidad, penetraciÃ³n y excelente acabado.Â Esta lÃ­nea de mezclas para soldar con proceso GTAW (TIG/TAG) se emplea tanto para procesos manuales como automatizados.</p><p>Incrementa la velocidad del proceso hasta un 30% comparada contra el ArgÃ³n puro, lo que proporciona un incremento en la productividad y reducciÃ³n de costos de producciÃ³n.</p><p>Permite un notable incremento en la velocidad de aplicaciÃ³n en cualquier espesor y una mayor limpieza en los cordones de soldadura.Â </p>', 'http://www.infra.com.mx/inframixx/inoxx.html', '41319', NULL, 0, '2011-08-15 20:36:11', 1, '2012-04-04 19:54:52', NULL, 0, 1, 0, 0),
(15, 'AIRE COMPRIMIDO', '(EconÃ³mico, con disponibilidad inmediata y libre de humedad o aceite)', 'img/gases/108.png', 'img/gases/thumb/108.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 108</strong></span></p><p><span>El Aire es un gas que se obtiene mediante la compresiÃ³n de aire atmosfÃ©rico o a partir de una mezcla elaborada de sus componentes (oxÃ­geno y nitrÃ³geno) mediante la destilaciÃ³n criogÃ©nica. El aire no tiene color, olor, ni sabor. No es un gas combustible pero favorece la combustiÃ³n. Es considerado un gas oxidante.</span></p><p><span><span>El Aire se utiliza en procesos de corte, tratamientos mÃ©dicos, operaciones de equipo neumÃ¡ticos, equipos autÃ³nomos de protecciÃ³n personal, ventilaciÃ³n mecÃ¡nica y es usado como propelente.Â </span></span>EstÃ¡ envasado en cilindros con capacidad de 6m3 y utiliza una vÃ¡lvula de conexiÃ³n denominada CGA 590.</p><p><span><span><br /></span></span></p>', 'http://www.infra.com.mx/servicio_atencion/libreria/gases/documentos/msds/aire.pdf', '108', NULL, 0, '2012-03-14 02:10:25', 3, '2012-05-29 20:48:55', NULL, 0, 0, 0, 1),
(16, 'NITRÃ“GENO INDUSTRIAL', '(Caracterizado por realizar cortes mÃ¡s rÃ¡pidos y limpios sobre materiales base)', 'img/gases/103.png', 'img/gases/thumb/103.png', '<p><span style="color: #ff0000;"><strong>CÃ³digo: 103</strong></span></p><p><span>El NitrÃ³geno Industrial es el producto de la separaciÃ³n del aire por medio de la licuefacciÃ³n y destilaciÃ³n del mismo.</span></p><p><span></span><span>Generalmente es empleado para procesos de corte, para la inertizaciÃ³n de sistemas elÃ©ctricos, en la industria quÃ­mica, petroquÃ­mica o en la industria de empacado de alimentos. Se utiliza tambiÃ©n para la inertizaciÃ³n de atmÃ³sferas en procesos varios y en usos mÃºltiples como refrigerante.</span></p><p><span><span>EstÃ¡ envasado en cilindros con capacidad de 9 m3, utilizando una vÃ¡lvula CGA-580. TambiÃ©n en presentaciones de Dewars de 105 m3 y termos estacionarios.</span></span></p>', '', '103', NULL, 0, '2012-03-14 02:11:18', 3, '2012-05-29 20:49:36', NULL, 0, 0, 0, 1);
