-serif; font-size: 11px; color: #000000;"><strong>Usos:</strong>Â <br />Adecuado para las soldadoras: CP 303, DELTAMIG 355 y los generadores BRONCO 252, BRONCO 311 de Gasolina.<br /><strong></strong></span></span></p><p><span style="font-family: Verdana, ''Verdana Ref''; font-size: 11px;"><span class="Estilo43" style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; color: #000000;"><strong>Ventajas:<br /></strong>Recortador de alambre integrado.</span></span></p>', 'http://www.infra.com.mx/sectores/productos/mercancias/soldadoras/alimentadores/pdf/ficha/3085F.pdf', '3085', NULL, 0, '2011-05-25 17:23:34', 3, '2012-02-02 15:21:28', NULL, 1, 0, 0, 0),
