(1, 'Careta ElectrÃ³nica Odisea 4400 (Mod. ClÃ¡sico) ', 'Careta ElectrÃ³nica Odisea 4400 (Mod. ClÃ¡sico)', 'img/protecciones/8213_nivo.jpg', 'img/protecciones/thumb/8213.png', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: black;">Modelo: </span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: black;">ClÃ¡sico</span></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: #fe1a1f;">CÃ³digo: 8213</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal; color: black;">CaracterÃ­sticas: </span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal; color: black;">Ventana panorÃ¡mica. Sombra variable #9-13, sombra #4 en estado pasivo. Ajuste de sensibilidad y sombra con potenciÃ³metro. Recargable a base de luz solar, suspensiÃ³n con ajuste de matraca. Equilibrio perfecto de productividad y control. DiseÃ±o dinÃ¡mico, excelente ajuste, componentes diseÃ±ados para desempeÃ±arse en todo tipo de procesos de soldadura, corte a plasma y corte con oxiacetileno.</span></p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;">Nuevo tamaÃ±o de cartucho electrÃ³nico (110 x 90 x 8 mm).</span></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal; color: black;">Ideal para trabajo industrial pesado.</span></strong></p><p class="MsoNormal"><strong><em><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-BldItlic;">* La careta Odisea cumple con las normas: NMX-9-041-1997, CE H0000-11-1987, ANSI-Z87.1-2003</span></em></strong></p>', '', '8213', 'SKU8213', 0, 3, '2011-04-22 18:46:40', 1, '2012-03-14 21:39:23', NULL, 1, 1, 1, 1),
(2, 'Peto de carnaza (Mod. 600)', 'Peto de carnaza (Mod. 600)', 'img/protecciones/5279_nivo.jpg', 'img/protecciones/thumb/5279.png', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal; mso-ansi-language: PT-BR;">Peto 84 cms. de largo</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: #fe1a1f; mso-ansi-language: PT-BR;">CÃ³digo: 5279</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;">PresentaciÃ³n:</span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;"> </span><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">Fabricados con carnaza gruesa y flexible, permiten la protecciÃ³n de partes vitales del soldador y su ropa contra salpique y escorias.</span></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;">Material:</span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;"> </span><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">Carnaza de res (vacuno) al grueso 1.5/1.6 mm. de espesor.</span></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;">Hilo:</span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;"> </span><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">Calibre 30/4 algodÃ³n, ojillos de latÃ³n, tira de polipropileno.</span></p><p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">ArtÃ­culos protectores de carnaza gruesa y flexible para proteger al soldador de las ch