(35, 'Tipo electricista econÃ³mico con ajuste en la muÃ±eca', 'Tipo electricista econÃ³mico con ajuste en la muÃ±eca', 'img/protecciones/5047.jpg', 'img/protecciones/thumb/5047.png', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: #fe1a1f; mso-ansi-language: PT-BR;">CÃ³digo: 5047</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;">Guante tipo electricista econÃ³mico con ajuste en la muÃ±eca Â 220-E</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld;">Unidad: </span></strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">Par</span></p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;">TamaÃ±o estÃ¡ndar, material en la palma y pulgar compuesto de piel de res (vacuno) grueso 1.2/1.3 mm. de espesor con ajuste de plÃ¡stico (dielÃ©ctrico) y en el dorso de la mano: piel grabada res con puÃ±o de carnaza al grueso 1.3/1.4 mm. Ideal para trabajos donde se requiera maniobrar con algÃºn tipo de herramienta de mano.</span></p>', '', '5047', NULL, 0, 2, '2012-03-14 04:38:01', 3, '2012-04-16 16:54:44', NULL, 0, 0, 0, 1),
(36, 'Mangas de carnaza', 'Mangas de carnaza', 'img/protecciones/5280.jpg', 'img/protecciones/thumb/5280.png', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Normal;">ML Mangas</span></strong></p><p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-bidi-font-family: AVGarde-Bld; color: #fe1a1f;">CÃ³digo: 5280</span></strong>Â </p><p class="MsoNormal"><strong>Unidad:Â </strong>Pares o por pieza.</p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;"><strong>PresentaciÃ³n</strong>: Fabricadas con carnaza gruesa y flexible, permiten la protecciÃ³n de partes vitales del soldador y su ropa contra salpique y escorias.</span></p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;"><strong>Material</strong><strong>:Â </strong>Carnaza de res (vacuno) al grueso 1.5/1.6 mm. de espesor.</span></p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;"><strong>Hilo:Â </strong>Calibre 30/4 algodÃ³n, ojillos de latÃ³n, tira de polipropileno.</span></p><p class="MsoNormal"><span style="font-family: Verdana; font-size: 11px;">ArtÃ­culos protectores de carnaza gruesa y flexible para proteger al soldador de las chispas y el calor que genera el arco al soldar, permite al usuario trabajar en condiciones de excelente seguridad y comodidad.</span></p>', '', '5280', NULL, 0, 6, '2012-03-14 18:03:56', 1, '2012-03-14 12:03:56', NULL, 1, 1, 1, 1);
